#include <stdio.h>
#include <math.h>
#include <string.h>
int main() {
    int n, t, i;
    char ans[5000] = "";
    while(scanf("%d %d", &n, &t) == 2) {
        if(n == 0)  break;
        printf("%s", ans);
        for(i = n-strlen(ans); i > 0; i--)
            printf("9");
        puts("");
    }
    return 0;
}
